    super(props)

    this.state = {
      firstVar: "Our page loaded",
      secondVar: 50,
      name: 'Robert'
    }
  }
  componentDidMount() {
    this.setState( { firstVar: 'Now it changed'})
  }
  render() {
    return (
      <div>
        <Banner />
        {this.state.firstVar}
